import { Card, Table } from 'antd';
import React from 'react'

export default function ExamenManMusc({ id_expediente, examenes, getExpedienteData }) {

    const columns = [
        {
            title: 'grupo',
            dataIndex: 'grupo',
            key: 'grupo',
        },
        {
            title: 'referencia',
            dataIndex: 'referencia',
            key: 'referencia',
        },
        {
            title: 'dolor',
            dataIndex: 'dolor',
            key: 'dolor',
        },
        {
            title: 'dinamometro',
            dataIndex: 'dinamometro',
            key: 'dinamometro',
        },
    ];

    return <div>

        Updating {id_expediente}
        <Table columns={columns} dataSource={examenes} size='small' bordered pagination={false} title={() => 'Examen manual muscular'} style={{ marginTop: 4 }} />
    </div>

}
